from typing import List


class Solution:
    def jump(self, nums: List[int]) -> int:
        jumps = [0]
        if len(nums)<=1:
            return 0
        for i in range(1, len(nums)): 
            jumps.append(float('inf') )
            for j in range(i): 
                if (i <= j + nums[j]) and (jumps[j] != float('inf')): 
                    jumps[i] = min(jumps[i], jumps[j] + 1) 
                    break
        return jumps[-1] 

